import React from 'react'
import { Link } from "react-router-dom";

const TopBar = () => {
	return (
		<nav className='navbar navbar-light' >
			<div className='container' >
				<Link to='/' className='navbar-brand'>
				Medium
				</Link>
			</div>
		</nav>
	)
}
export default TopBar;
